Information
------------------------------

Monster Croc Search for a Killer
As the human population expands deeper into the wild, animals are fighting back to protect their future. Wildlife cameramen Jim and Jason dedicate their lives to investigating and solving human and animal conflicts in remote regions of Earth. In Monster Croc Search for a Killer, Jim and Jason travel to Belize where a mammoth crocodile nicknamed &quot;Croczilla&quot; is preying on the locals. Scarier than Croczilla are the actions of local poachers, who shoot first and answer questions later. Jim and Jason are in a race against time to interview locals and locate Croczilla before the poachers take matters into their own hands.

